INSERT INTO `observaciones` VALUES (3,41,'La reparación de la vereda que solicita la vecina como consecuencia del cambio de un poste, no corresponde a mi Dirección de Ejecución de Plazas y Espacios Públicos','2017-04-11 11:51:21'),(4,41,'La reparación del bache solicitado por el vecino no corresponde a mi Dirección de Ejecución de Plazas y Espacios Públicos','2017-04-11 11:53:43'),(5,30,'Se contactó con la vecina. \nLa vecina dijo que no es AySA, sino ABSA la proveedora de agua. Se le brindó el numero de Asistencia Técnica para que pueda realizar el correspondiente reclamo.','2017-04-11 12:34:44'),(6,30,'Se contactó con la vecina, dijo que ella no había hecho el reclamo correspondiente en AySA. \nDesde esta oficina se hará dicho reclamo y se le informó que  primero debe hacer el reclamo en AySA para poder llegar a una solución más rápido.','2017-04-11 12:52:05'),(7,30,'Se contactó con AySA y el mismo nos informó que por tareas de mantenimiento, se verá con falta de presion hasta el día 11/04/2017 a las 23:59pm','2017-04-11 12:56:42'),(8,36,'se llamo al vecino y nos manifiesta que el reclamo que realizo no fue por la recoleccion de ramas , sino por la poda de un arbol en la vereda de su casa que esta en riesgo de caerce , ','2017-04-12 09:58:45'),(9,36,'se llama a la persona pero no atiende nadie','2017-04-12 10:27:25'),(10,36,'se llama a la persona , pero no atiende nadie','2017-04-12 10:27:51'),(11,36,'se acordo en realizar la recoleccion de las ramas en 48 hs ','2017-04-12 10:54:47'),(12,36,'se acordo en realizar la recoleccion de las ramas en 48 hs','2017-04-12 10:55:15'),(13,36,'se acordo en realizar la recoleccion de las ramas en 48 hs','2017-04-12 10:55:26'),(14,36,'se acordo en realizar la recoleccion de las ramas en 48 hs','2017-04-12 10:55:33'),(15,36,'se acordo en realizar la recoleccion de las ramas en 48 hs','2017-04-12 10:55:37'),(16,30,'NO CORRESPONDE A AGUA Y CLOACAS','2017-04-12 13:59:12'),(17,68,'Se procede a cortar y despejar la rama  en cuestión.el dia 11/04/  se llama la CAV. COMO AL DELEGADO DE JAGUEL.   para retirar el mismo. ','2017-04-12 15:41:52'),(18,68,'Se corto  cables eléctricos, el dia 11/04 se procede a vallar el mismo, se llama al responsables como al cav. para su reclamo correspondiente. ','2017-04-12 15:44:26'),(19,68,'No se puede comunicar con el vecino . se le hara una visita  por parte del personal de dc.','2017-04-12 15:51:32'),(20,34,'no se sabe cual es la calle , aparece el nombre del vecino en dirección, aparentemente en comentarios dice Mte. Gde.','2017-04-12 15:52:09'),(21,68,'No atiende, se realizará una visita del personal de dc.','2017-04-12 15:56:07'),(22,68,'El numero es incorrecto se realizara una visita del personal de dc','2017-04-12 15:58:04'),(23,68,'Se procede a cortar un árbol caído entre los cables eléctricos , se llama al cav , para que informe a delegacion su el retiro delos mismo.','2017-04-12 16:02:02'),(24,34,'Se le informo a la vecina que se realizara a la mayor brevedad posible, se realizara dentro de las 48 hs laborales.','2017-04-12 16:02:20'),(25,68,'se pone en conocimiento que no se pudo conectar con el vecino.','2017-04-12 16:02:47'),(26,68,'No se puede comunicar con el vecino , no atiende se realizar una visita con el personal de dc','2017-04-12 16:07:56'),(27,68,'Responsables de luminaria ','2017-04-12 17:24:53'),(28,68,'no se pudo  contacta con la vecino , se procede a hacerle una visita por el personal de dc','2017-04-12 17:28:07'),(29,68,'El dia 11/03, 16 hs  no se logro comunicar con la vecina,  \nSe procede a realizarl una visita ocular , dando positivo , el reclamo de las misma.\nSe habla con la vecina arreglando con la misma que mediado de la semana entrante se realizara los trabajos de despeje, quedando la misma conforme con lo hablado.','2017-04-13 06:57:43'),(30,68,'El dia 12/04 siendo las 20 hs  se realiza una visita al vecino ,  confirmando que ya esta solucionado el problema ,\nInforma que solicita el arreglo de la sanja por en el incidente  se tapo.\nSe aclara  que el dia 11/04 se presento dc y vallo la zona por el llamado del cav.','2017-04-13 07:04:22'),(31,68,'El dia 12/04 siendo la s 18 hs se presento el móvil de dc.\nSe hablo con el vecino, acordado con el mismo que la semana entrante se realizara el trabajo de despeje del árbol en cuestion.','2017-04-13 07:06:49'),(32,68,'Se pone en conocimiento que el día 11/04 se realizo el trabajo de despeje, se llamo al cav para realizar el trabajo de recolección de las ramas cortadas por parte de la delegación Jaguel.','2017-04-13 07:10:50'),(33,68,'El dia 12/04 no se pudo contacta con la  vecina.\nSe realizara una visita del personal de dc.\n','2017-04-13 07:26:37'),(34,68,'Se llama al cav para que informe a luminaria que son cables de edesur a baja altura 13/04/17','2017-04-13 07:33:51'),(35,34,'pertenece a Servicios Mte Gde.','2017-04-13 09:06:04'),(36,34,'Se llamo a la vecina y se le informo que se realizara a la mayor brevedad posible. Dentro de las 48 hs.','2017-04-13 09:12:50'),(37,34,'Se informo a la vecina que ni bien se arregle la maquina Motoniveladora que esta rota se va a realizar el mejorado de la calle. muy agradecidos por la llamada.','2017-04-13 09:18:56'),(38,34,'Se le aviso al vecino que se realizara la rec. de ramas en el transcurso de la semana. vecina agradecida por el llamado.','2017-04-13 09:28:36'),(39,34,'pertenece a Mte. Gde. ','2017-04-13 09:29:27'),(40,34,'Derivar al área que corresponda, se llamo al vecino e informo que rompió el auto con un pozo en B. BS.AS. (Infraestructura)','2017-04-13 09:34:03'),(41,34,'El vecino muy contento, el trabajo se realizo en el día de la fecha 13/4/17. REALIZADO. vecino muy conforme.','2017-04-13 09:39:13'),(42,34,'derivar a infraestructura, calle asfaltada.','2017-04-13 09:53:26'),(43,34,'Pertenece a Mte. Gde.','2017-04-13 09:54:47'),(44,34,'pertenece a MTE: GDE.','2017-04-13 09:55:12'),(45,68,'Se presenta móvil de dc, se habla con la vecina, observando que son postes de media tensión , se llama al Sr. Andres Herrera para llamar urgente a edesur, se valla la zona , como también se le comunica al cav  de los sucedido','2017-04-13 09:56:15'),(46,68,'El dia 11/04 17 hs no se pudo comunicar con la vecina no atendía.\n\nEn el día de la fecha  se realiza vista ocular del árbol  en cuestión, se conversa con el vecino. \nEl árbol  necesita que se le realice poda por su gran tamaño\nSe llama al cav para que informa a a medio ambiente para su posterior poda.','2017-04-13 10:00:46'),(47,34,'Se llamo y se informo, que cuando se solucione el problema de la Motoniveladora rota , se realizara el trabajo a la brevedad.','2017-04-13 10:02:11'),(48,34,'Se aviso al vecino que se va a volver a retirar las ramas y basura en breve.','2017-04-13 10:05:24'),(49,68,'El dia 12 /04 no se pudo comunica con la vecina.\n\nEn el día  de la fecha se realiza vista ocular del poste en cuestión , se observa que es un poste de madera con luminaria municipal , el poste es municipal , inclinado y en estado de deterioro. La vecina necesita que lo cambien de el lugar porque no puede meter su automóvil dentro de su casa, se llama al cav para informar \n','2017-04-13 10:06:37'),(50,68,'El dia 12/04 no se puedo contactar con el vecino.\n\n\nEn el dia de la fecha se realiza una vista ocular del árbol en cuestión, se observa una arbol l de gran porte que necesita que se reilase poda.\nse procede a informa al cav para que informe a medio ambiente.','2017-04-13 10:10:37'),(51,36,'Este reclamo pertenece a la UGT de L.Guillon y/o Servicio','2017-04-15 09:16:37'),(52,36,'Este reclamo pertenece a la UGT de L.Guillon y/o Servicio','2017-04-15 09:17:46'),(53,36,'Reclamo Perteneciente a Servicio','2017-04-15 09:18:42'),(54,36,'Reclamo Perteneciente a Servicio','2017-04-15 09:19:14'),(55,36,'Reclamo que no  corresponde a la UGT N.Malvinas Mt Gd Norte','2017-04-15 09:20:21'),(56,117,'Esta seria la primer observacion para una verificacion de contactado','2017-06-16 14:05:05'),(57,31,'observacion loca','2017-06-27 14:42:21'),(58,31,'<p>no se bien que poner</p>','2017-07-17 20:17:10'),(59,31,'<p>estoy probando los valores de <b>html</b> para que quede lindo =) </p>','2017-07-17 20:18:08'),(60,NULL,NULL,'2017-07-19 22:14:08');
